import { createSlice, createAsyncThunk } from '@reduxjs/toolkit'

const initialState = {
    rooms: [
        { id: "1", name: "IT"},
        { id: "2", name: "Politics"},
        { id: "3", name: "Football"}
    ],
    status: 'idle',
    error: null
}

const roomsSlice = createSlice({
    name: 'rooms',
    initialState,
    reducers: {}
})

export default roomsSlice.reducer
